import React from "react";
function Helo(props){
    return(
        <div>
            cores:{props.coures}<br/>
            amount:{props.amount}<br/>
        </div>
    )
}

function Hello(){
    return(
        <div>
            <Hello coures="full stack python developer" amount="40000"/>
        </div>
    )
}
export default Hello;
